import React from 'react';
import './App.css';
import Home from './pages/Home.js';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            loggedIn: false
        }
    }
    render() {
        <div className="App">
            <Home/>
        </div>
    }
}

export default App;
